""""        Trapping Rain Water ==> Hard 


Given n non-negative integers representing an elevation
 map where the width of each bar is 1, compute how much
   water it can trap after raining.

Example 1:

Input: height = [0,1,0,2,1,0,1,3,2,1,2,1]
Output: 6
Explanation: The above elevation map (black section) is represented by array [0,1,0,2,1,0,1,3,2,1,2,1]. In this case, 6 units of rain water (blue section) are being trapped.
Example 2:

Input: height = [4,2,0,3,2,5]
Output: 9

To undestand more look at the images in the provided link 

    Link : https://leetcode.com/problems/trapping-rain-water/description/
"""

#baseclly this code uses pointers to fill line by line 
#and i am happy to solve it my self  :)
class Solution:
    def trap(self, height):
        l , r = 0, len(height)-1     
        out =0

        while l+1 < r:
            while height[l]==height[r]==min(height) and l<r : # if all the elements are equale 
                l+=1
                r-=1

            while height[l]<height[l+1]  and l+1<r : 
                l+=1
                print(r,l)
            while height[r]<height[r-1]and l+1<r :
                r-=1
                print(r,l)
            
            x = min(height[l],height[r])

            for i , ele in enumerate(height[l+1:r]):
                if ele < x:
                    out+=(x-ele)
                    height[i+l+1]=x
            
            if height[l] < height[r]:
                l+=1
            else:
                r-=1
        return out


